  providedIn: 'root'
})

export class MenuCafeService {
  constructor(private http: HttpClient) {

  }
  getAll(): Observable<IMenuCafe[]> {
    return this.http.get<IMenuCafe[]>('http://localhost/api/MenuCafe/GetAll')
  }
}
